import React from 'react';
import { Link } from "react-router-dom";
import styled from 'styled-components';

function ScroeBoard() {
    return (
        <div>
            <Title>ScroeBoard</Title>
            <Link to="/">Back</Link>
        </div>
    );
  }
export default ScroeBoard;


const Title = styled.h1`
  font-size: calc(5px + 2vmin);
`
